        public string GetLicense(
          string VolumeSerial,
          string NicAddr,
          string ComputerName,
          string Edition,
          string Option,
          string InstallationID,
          DateTime ExpirationDate)
        {
            BlowFish blowFish = new BlowFish(new WhirlpoolManaged().ComputeHash(askjfhskd));
            csp = new RSACryptoServiceProvider();
            csp.ImportCspBlob(blowFish.Decrypt_CBC(stfu8riqjfrm));
            int num = new Random().Next(3000001, 4999999);
            string data1 = string.Format(Encoding.ASCII.GetString(blowFish.Decrypt_CBC(afounhrqiouhri)), DateTime.UtcNow, ExpirationDate, Edition, num, ComputerName, VolumeSerial, NicAddr, Option, InstallationID);
            string data2 = string.Format(Encoding.ASCII.GetString(blowFish.Decrypt_CBC(faijfiouqorwf)), DateTime.UtcNow, ExpirationDate, Edition, num, ComputerName, VolumeSerial, NicAddr, Option, InstallationID);
            return string.Format(Encoding.ASCII.GetString(blowFish.Decrypt_CBC(aiogeqorhgifre)), Convert.ToBase64String(Encrypt(data1)), Convert.ToBase64String(Sign(data2)));
        }

        private byte[] Sign(string data)
        {
            if (csp == null)
                throw new InvalidOperationException("RSACryptoServiceProvider is not initialized.");

            using var sha1 = SHA1.Create();
            return csp.SignData(Encoding.UTF8.GetBytes(data), sha1);
        }


        private byte[] Encrypt(string data)
        {
            if (csp == null)
                throw new InvalidOperationException("RSACryptoServiceProvider is not initialized.");
            byte[] bytes = Encoding.UTF8.GetBytes(data);
            MemoryStream memoryStream = new MemoryStream();
            for (int sourceIndex = 0; sourceIndex < data.Length; sourceIndex += 64)
            {
                byte[] numArray = new byte[sourceIndex + 64 < data.Length ? 64 : data.Length - sourceIndex];
                Array.Copy(bytes, sourceIndex, numArray, 0, numArray.Length);
                byte[] buffer = csp.Encrypt(numArray, true);
                memoryStream.Write(buffer, 0, buffer.Length);
            }
            return memoryStream.ToArray();
        }
